import React from 'react'

const Intro = () => {
    const style = {
        "background-image": `url("images/bgimg2.jpg")`,
        "background-repeat": "no-repeat",
        "background-size": "cover",
        position: "absolute",
        height: "100%",
        width: "100%"
    }
    return <div style={style}></div>
}
    function HomePage() {
        return <div>
            <Intro />
        </div>
    }


export default HomePage
